import React from 'react'

const ShowHighestVolume = (volume) => {
    return (
        <div>
            console.log(volume[0])
            <h1 style={{ color: 'steelblue', backgroundColor:'black'  }}>Date of highest volume</h1>
            <h1 style={{ color: 'steelblue', backgroundColor:'black'  }}>Test{volume[1]} </h1>
        </div>
    )
}

export default ShowHighestVolume
